package com.javatesting.practiceprogram;

public class QubeDoWhile {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int res=1;
		int i=10;
		do
		{
			res=i*i*i;
			String result="Cube*"+i+"="+res;
			{
				System.out.println(result);
			}
			i--;
		}
		 while(i>=1);

	}

	}


